import React from 'react'
//css
import './Field.css'
//componenets
import Checkbox from '../Checkbox/Checkbox'


export default function Field(props) {

    const fetchPokemon = () => {
        props.fetchPokemon()
    }

    return (
        <div className="Field">
            {props.stats.map((stat) => {
                return <Checkbox onClick={fetchPokemon} value={stat} key={stat}/>
            })}
        </div>

    )
}
